import React from 'react';
import { Parallax, Background } from 'react-parallax';
import './App.css';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import About from './components/About/About';
import Contact from './components/Contact/Contact';
import Navigation from './components/Navigation/Nav';
import Projects from './components/Projects/Projects';
import worldMap from './assets/images/Old-world-map.jpeg'
import forrest from './assets/images/SQDPTbanner.png';
import woods from './assets/images/woods.png';



function App() {

  return (
    <div className="App">
      <Parallax bgImage={woods} strength={300}>
        <div className="image1">
          <div className="box">sample text </div>
        </div>
      </Parallax>
      <Parallax bgImage={worldMap} strength={300}>
      <div className="div2">

      </div>
      </Parallax>
    </div>
  );
}


export default App;
